const REPO   = 'wr98-code/new-zeromeridian';
const TOKEN  = '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';
const BRANCH = 'main';
const BASE   = 'https://api.github.com';
const H = {
  'Authorization': `token ${TOKEN}`,
  'Content-Type':  'application/json',
  'User-Agent':    'zeromeridian-push',
};

async function sha(path) {
  const r = await fetch(`${BASE}/repos/${REPO}/contents/${path}?ref=${BRANCH}`, { headers: H });
  if (!r.ok) return null;
  return (await r.json()).sha ?? null;
}

async function push(path, b64) {
  const s = await sha(path);
  const body = { message: `push89: ${path}`, content: b64, branch: BRANCH };
  if (s) body.sha = s;
  const r = await fetch(`${BASE}/repos/${REPO}/contents/${path}`, {
    method: 'PUT', headers: H, body: JSON.stringify(body),
  });
  if (!r.ok) throw new Error(await r.text());
}

const FILES = {
  "src/components/shared/GlobalStatsBar.tsx": "",
  "src/components/layout/Topbar.tsx": "",
  "src/pages/Dashboard.tsx": "",
  "src/pages/Portal.tsx": "",
  "src/components/layout/AppShell.tsx": "",
  "src/components/layout/ZMSidebar.tsx": "",
  "src/components/layout/BottomNavBar.tsx": "",
  "src/components/shared/MetricCard.tsx": "",
  "src/components/shared/GlassCard.tsx": "",
  "src/components/shared/CommandPalette.tsx": "",
  "src/index.css": ""
};

async function main() {
  const keys = Object.keys(FILES);
  console.log('\n🚀 push89 — ZERØ MERIDIAN v30 Bloomberg Fix');
  console.log(`📦 ${keys.length} files → ${REPO}\n`);
  for (const path of keys) {
    try {
      await push(path, FILES[path]);
      console.log(`  ✅ ${path}`);
    } catch(e) {
      console.error(`  ❌ ${path}: ${e.message}`);
    }
  }
  console.log('\n✨ push89 selesai! Cloudflare auto-deploy...\n');
}

main().catch(console.error);
